window.bookSummaryJSON = "<p><b>Falling in love can be hell...</b></p> <p>As the danger increases around me, Sayah’s darkness grows inside me.</p> <p>Scariest of all…I’m starting to like it.</p> <p>My sin demons will risk it all to save me from eternal damnation. But my biggest enemy may not be Lucifer.</p> <p>It may be the monster that lurks inside me.</p> <p>And when we meet the devil at the gates of hell, will I be strong enough to make the ultimate sacrifice to save us all? Or will I lose everyone I love to the fire?</p> <p><i>Sin Demons </i>is a fiery paranormal romance series full of dominating hellions, gritty humor, underworld mystery, and a lost heroine embracing her faults to find her true power. This is a reverse harem/why choose series.</p> <p>This set includes the last three books in the Sin Demons Series—<b><i>To Hell and Back</i></b><b>, </b><b><i>When Hell Freezes Over</i></b><b>, and </b><b><i>Hell on Earth</i></b>—plus new exclusive bonus content and character illustrations.</p>"; 
